import React from "react";
import { Container, Row, Col, Button } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import "./StartPage.css"; // Importa el archivo CSS

const StartPage = () => {
  const navigate = useNavigate();

  const handleStartClick = () => {
    navigate("/home"); // Ajusta la ruta según sea necesario
  };

  return (
    <Container fluid className="start-page">
      <Row>
        <Col className="text-center">
          <Button variant="primary" size="lg" onClick={handleStartClick}>
            Conoce a lo Pokémons
          </Button>
        </Col>
      </Row>
    </Container>
  );
};

export default StartPage;
